import React from 'react';
import {BrowserRouter} from 'react-router-dom';
import Home2 from './Home2';
const Routes = () =>{
        return(
        <BrowserRouter>
            <div>
            <Route path = '/' component ={Home2}></Route>
            </div>
        </BrowserRouter>
        )
    }
export default Routes;
